import React from 'react'
import useScreen from '../hook/useScreen'

function FilesUI({content}) {
    const large = useScreen()
    console.log(content)

    if(content.lenght>0){
        return (
            <div className={`grid ${large ? 'grid-cols-3':'grid-cols-2'}`}>
                {content.map((elt, indx) =><img alt={`file${indx}`} src={elt}/>)}
                <h3>hi</h3>
            </div>
        )}
    return(
        <div className='h-64 flex justify-center items-center'>
            <p className='animate-spin text-white p-4 border-2 border-blue-500 rounded-full w-12 h-12 border-b-white'> hi</p>
        </div>
    )
    

}

export default FilesUI
